import ClientBookPage from "./ClientBookPage";

const MainPage = () => {
  return (
    <>
      <Head />
      {localStorage.getItem("token") === "admin" ? (<BookTable />) : (<ClientBookPage />)}
      <Footer />
    </>
  );
};

export default MainPage;
